import React from 'react';
import styled from 'styled-components';

function GridArticle() {
	return (
		<ComponentWrapper>
			<div className="box-subscribe">
				<div className="box-title-wrapper">
					wanted+구독해야 하는 이유
				</div>
				<p>
					구독자의 서류 합격률이 비구독자보다 <span>1.5배</span>{' '}
					높아요!
				</p>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	flex-direction: row;
	align-self: auto;
	flex-wrap: nowrap;
	align-items: center;
	justify-content: space-between;
	box-sizing: border-box;
	display: flex;
	width: 100%;
	.box-subscribe {
		align-items: flex-start;
		align-self: auto;
		flex-wrap: nowrap;
		align-items: flex-start;
		justify-content: flex-start;
		flex-direction: column;
		margin: 0;
		box-sizing: border-box;
		display: flex;
		width: 100%;
	}
	.box-title-wrapper {
		font-size: 30px;
		font-weight: 700;
		word-break: keep-all;
		flex-direction: row;
		align-items: flex-start;
	}
`;
export default GridArticle;
